INSERT INTO `wp_posts` VALUES (1,1,'2018-05-06 14:48:20','2018-05-06 14:48:20','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-05-06 14:48:20','2018-05-06 14:48:20','',0,'http://tayta.loc/?p=1',0,'post','',1),(2,1,'2018-05-06 14:48:20','2018-05-06 14:48:20','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://tayta.loc/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-05-06 14:48:20','2018-05-06 14:48:20','',0,'http://tayta.loc/?page_id=2',0,'page','',0),(4,1,'2018-05-06 15:15:02','2018-05-06 15:15:02','','Shop','','publish','closed','closed','','shop','','','2018-05-06 15:15:02','2018-05-06 15:15:02','',0,'http://tayta.loc/shop/',0,'page','',0),(5,1,'2018-05-06 15:15:02','2018-05-06 15:15:02','[woocommerce_cart]','Giỏ hàng','','publish','closed','closed','','cart','','','2018-05-06 15:15:02','2018-05-06 15:15:02','',0,'http://tayta.loc/cart/',0,'page','',0),(6,1,'2018-05-06 15:15:03','2018-05-06 15:15:03','[woocommerce_checkout]','Thanh toán','',