 La Vang</b>) là một nhà thờ <a title=\"Giáo hội Công giáo Rôma\" href=\"https://vi.wikipedia.org/wiki/Gi%C3%A1o_h%E1%BB%99i_C%C3%B4ng_gi%C3%A1o_R%C3%B4ma\">Công giáo Rôma</a> thuộc <a title=\"Tổng giáo phận Huế\" href=\"https://vi.wikipedia.org/wiki/T%E1%BB%95ng_gi%C3%A1o_ph%E1%BA%ADn_Hu%E1%BA%BF\">Tổng Giáo phận Huế</a>, tọa lạc ở xã <a class=\"mw-disambig\" title=\"Hải Phú\" href=\"https://vi.wikipedia.org/wiki/H%E1%BA%A3i_Ph%C3%BA\">Hải Phú</a>, huyện <a title=\"Hải Lăng\" href=\"https://vi.wikipedia.org/wiki/H%E1%BA%A3i_L%C4%83ng\">Hải Lăng</a>, tỉnh <a title=\"Quảng Trị\" href=\"https://vi.wikipedia.org/wiki/Qu%E1%BA%A3ng_Tr%E1%BB%8B\">Quảng Trị</a>, <a title=\"Việt Nam\" href=\"https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam\">Việt Nam</a>. Đây là một trung tâm <a title=\"Hẹ tây\" href=\"https://vi.wikipedia.org/wiki/H%E1%BA%B9_t%C3%A2y\">hành hương</a> lớn của <a title=\"Người Công giáo\" href=\"https://vi.wikipedia.org/wiki/Ng%C6%B0%E1%BB%9Di_C%C3%B4ng_gi%C3%A1o\">người Công giáo</a> Việt Nam. Nhà thờ được <a title=\"Giáo hoàng Gioan XXIII\" href=\"https://vi.wikipedia.org/wiki/Gi%C3%A1o_ho%C3%A0ng_Gioan_XXIII\">Giáo hoàng Gioan XXIII</a> tôn phong là <a title=\"Vương cung thánh đường\" href=\"https://vi.wikipedia.org/wiki/V%C6%B0%C6%A1ng_cung_th%C3%A1nh_%C4%91%C6%B0%E1%BB%9Dng\">vương cung thánh đường</a> qua <i>Sắc chỉ Magnonos</i> ngày <a title=\"22 tháng 8\" href=\"https://vi.wikipedia.org/wiki/22_th%C3%A1ng_8\">22 tháng 8</a> năm <a title=\"1961\" href=\"https://vi.wikipedia.org/wiki/1961\">1961</a>.','publish','open','closed','','thap-co-la-vang','','','2018-06-11 13:35:54','2018-06-11 13:35:54','',0,'http://tayta.loc/?post_type=product&#038;p=279',0,'product','',0),(280,1,'2018-06-11 13:30:32','2018-06-11 13:30:32','','IMG_8548','','inherit','open','closed','','img_8548','','','2018-06-11 13:30:32','2018-06-11 13:30:32','',279,'http://tayta.loc/wp-content/uploads/2018/06/IMG_8548.jpg',0,'attachment','image/jpeg',0),(281,1,'2018-06-11 13:32:24','2018-0