ul>','Phố cổ Hội An','<b>Phố cổ Hội An</b> là một đô thị cổ nằm ở hạ lưu <a title=\"Sông Thu Bồn\" href=\"https://vi.wikipedia.org/wiki/S%C3%B4ng_Thu_B%E1%BB%93n\">sông Thu Bồn</a>, thuộc vùng đồng bằng ven biển tỉnh <a title=\"Quảng Nam\" href=\"https://vi.wikipedia.org/wiki/Qu%E1%BA%A3ng_Nam\">Quảng Nam</a>, <a title=\"Việt Nam\" href=\"https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam\">Việt Nam</a>, cách thành phố Đà Nẵng khoảng 30 km về phía Nam. Nhờ những yếu tố địa lý và khí hậu thuận lợi, <b><a title=\"Hội An\" href=\"https://vi.wikipedia.org/wiki/H%E1%BB%99i_An\">Hội An</a></b> từng là một thương cảng quốc tế sầm uất, nơi gặp gỡ của những thuyền buôn <a title=\"Nhật Bản\" href=\"https://vi.wikipedia.org/wiki/Nh%E1%BA%ADt_B%E1%BA%A3n\">Nhật Bản</a>, <a title=\"Trung Quốc\" href=\"https://vi.wikipedia.org/wiki/Trung_Qu%E1%BB%91c\">Trung Quốc</a> và phương Tây trong suốt thế kỷ XVII và XVIII. Trước thời kỳ này, nơi đây cũng từng có những dấu tích của thương cảng <a title=\"Chăm Pa\" href=\"https://vi.wikipedia.org/wiki/Ch%C4%83m_Pa\">Chăm Pa</a> hay được nhắc đến cùng con đường tơ lụa trên biển','publish','open','closed','','pho-co-hoi-an','','','2018-06-11 15:36:06','2018-06-11 15:36:06','',0,'http://tayta.loc/?post_type=product&#038;p=345',0,'product','',0),(346,1,'2018-06-11 15:04:04','2018-06-11 15:04:04','','IMG_8563','','inherit','open','closed','','img_8563','','','2018-06-11 15:04:04','2018-06-11 15:04:04','',345,'http://tayta.loc/wp-content/uploads/2018/06/IMG_8563.jpg',0,'attachment','image/jpeg',0),(347,1,'2018-06-11 15:05:15','2018-06-11 15:05:15','','IMG_8366','','inherit','open','closed','','img_8366','','','2018-06-11 15:05:15','2018-06-11 15:05:15','',345,'http://tayta.loc/wp-content/uploads/2018/06/IMG_8366.jpg',0,'attachment','image/jpeg',0),(348,1,'2018-06-11 15:06:05','2018-06-11 15:06:05','','IMG_8372','','inherit','open','closed','','img_8372','','','2018-06-11 15:06:05','2018-06-11 15:06:05','',345,'http://tayta.loc/wp-content/uploads/2018/