g/wikipedia/commons/thumb/0/02/Ayuntamiento%2C_Ciudad_Ho_Chi_Minh%2C_Vietnam%2C_2013-08-14%2C_DD_09.JPG/420px-Ayuntamiento%2C_Ciudad_Ho_Chi_Minh%2C_Vietnam%2C_2013-08-14%2C_DD_09.JPG 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/0/02/Ayuntamiento%2C_Ciudad_Ho_Chi_Minh%2C_Vietnam%2C_2013-08-14%2C_DD_09.JPG/560px-Ayuntamiento%2C_Ciudad_Ho_Chi_Minh%2C_Vietnam%2C_2013-08-14%2C_DD_09.JPG 2x\" alt=\"Ayuntamiento, Ciudad Ho Chi Minh, Vietnam, 2013-08-14, DD 09.JPG\" width=\"280\" height=\"182\" data-file-width=\"5206\" data-file-height=\"3390\" /></a>\r\n<div>Mặt trước trụ sở về đêm</div></td>\r\n</tr>\r\n<tr>\r\n<th colspan=\"2\">Thông tin chung</th>\r\n</tr>\r\n<tr>\r\n<th scope=\"row\">Địa điểm</th>\r\n<td class=\"label\">86 Lê Thánh Tôn, phường <a class=\"mw-disambig\" title=\"Bến Nghé\" href=\"https://vi.wikipedia.org/wiki/B%E1%BA%BFn_Ngh%C3%A9\">Bến Nghé</a>, <a class=\"mw-redirect\" title=\"Quận 1, thành phố Hồ Chí Minh\" href=\"https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_1,_th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh\">Quận 1</a>, <a title=\"Thành phố Hồ Chí Minh\" href=\"https://vi.wikipedia.org/wiki/Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh\">thành phố Hồ Chí Minh</a>, <a title=\"Việt Nam\" href=\"https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam\">Việt Nam</a></td>\r\n</tr>\r\n<tr>\r\n<th scope=\"row\"><a title=\"Hệ tọa độ địa lý\" href=\"https://vi.wikipedia.org/wiki/H%E1%BB%87_t%E1%BB%8Da_%C4%91%E1%BB%99_%C4%91%E1%BB%8Ba_l%C3%BD\">Tọa độ</a></th>\r\n<td><span class=\"plainlinks nourlexpansion\"><img class=\"wmamapbutton noprint\" title=\"xem vị trí này trên bản đồ tương tác\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/5/55/WMA_button2b.png/17px-WMA_button2b.png\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/5/55/WMA_button2b.png/17px-WMA_button2b.png 1x, //upload.wikimedia.org/wikipedia/commons/thumb/5/55/WMA_button2b.png/34px-WMA_button2b.png 2x\" alt=\"\" /><a class=\"external text\" href=\"https://tools.wmflabs.org/geohack/geohack.php?language=vi&amp;pagename=Tr%E1%BB%A5_s%E1%BB%9F_%E1%BB%A6y_ban_nh%C3%A2n_d%C3%A2n_Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh&amp;params=10.776532_N_106.700828_E_type:landmark\"><span class=\"geo-default\"><span class=\"geo-dms\" title=\"Bản đồ, không ảnh, cùng các dữ liệu khác cho vị trí này\"><span class=\"latitude\">10°46′36″B</span> <span class=\"longitude\">106°42′03″Đ</span></span></span></a></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<b>Trụ sở Ủy ban nhân dân Thành phố Hồ Chí Minh</b> là một trong những công trình kiến trúc cổ kính nổi tiếng của <a title=\"Thành phố Hồ Chí Minh\" href=\"https://vi.wikipedia.org/wiki/Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh\">Thành phố Hồ Chí Minh</a>, <a title=\"Việt Nam\" href=\"https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam\">Việt Nam</a>, được xây dựng từ năm <a title=\"1898\" href=\"https://vi.wikipedia.org/wiki/1898\">1898</a> đến <a title=\"1909\" href=\"https://vi.wikipedia.org/wiki/1909\">1909</a> do kiến trúc sư Femand Gardès<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://vi.wikipedia.org/wiki/Tr%E1%BB%A5_s%E1%BB%9F_%E1%BB%A6y_ban_nh%C3%A2n_d%C3%A2n_Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh#cite_note-1\">[1]</a></sup> thiết kế mô phỏng theo kiểu những lầu chuông ở miền bắc nước <a title=\"Pháp\" href=\"https://vi.wikipedia.org/wiki/Ph%C3%A1p\">Pháp</a>. Thời <a title=\"Pháp thuộc\" href=\"https://vi.wikipedia.org/wiki/Ph%C3%A1p_thu%E1%BB%99c\">Pháp thuộc</a>, tòa nhà này có tên là <i><b>Hôtel de ville</b></i> trong tiếng Pháp hay <b>Dinh xã Tây</b> trong tiếng Việt. Đến thời <a title=\"Việt Nam Cộng hòa\" href=\"https://vi.wikipedia.org/wiki/Vi%E1%BB%87t_Nam_C%E1%BB%99ng_h%C3%B2a\">Việt Nam Cộng hòa</a> gọi là <b>Tòa đô chánh Sài Gòn</b> hay <b>Tòa đô sảnh Sài Gòn</b>, là nơi làm việc và hội họp của chính quyền thủ đô. Từ sau sự kiện 30 tháng 4 năm 1975 đến nay, tòa nhà là nơi làm việc của <a title=\"Ủy ban nhân dân Thành phố Hồ Chí Minh\" href=\"https://vi.wikipedia.org/wiki/%E1%BB%A6y_ban_nh%C3%A2n_d%C3%A2n_Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh\">Ủy ban nhân dân Thành phố Hồ Chí Minh</a>; địa chỉ hiện nay là số 86 đường Lê Thánh Tôn, Phường Bến Nghé, <a class=\"mw-redirect\" title=\"Quận 1, thành phố Hồ Chí Minh\" href=\"https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_1,_th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh\">Quận 1</a>, nằm ngay ở đầu <a title=\"Đường Nguyễn Huệ, Thành phố Hồ Chí Minh\" href=\"https://vi.wikipedia.org/wiki/%C4%90%C6%B0%E1%BB%9Dng_Nguy%E1%BB%85n_Hu%E1%BB%87,_Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh\">đại lộ Nguyễn Huệ</a>.','publish','open','closed','','tru-so-uy-ban-nhan-dan-thanh-pho-ho-chi-minh','','','2018-06-13 03:10:44','2018-06-13 03:10:44','',0,'http://tayta.loc/?post_type=product&#038;p=360',0,'product','',0),(361,1,'2018-06-13 02:55:56','2018-06-13 02:55:56','','IMG_8536','','inherit','open','closed','','img_8536','','','2018-06-13 02:55:56','2018-06-13 02:55:56','',360,'http://tayta.loc/wp-content/uploads/2018/06/IMG_8536.jpg',0,'attachment','image/jpeg',0),(362,1,'2018-06-13 02:58:19','2018-06-13 02:58:19','','IMG_8327','','inherit','open','closed','','img_8327','','','2018-06-13 02:58:19','2018-06-13 02:58:19','',360,'http://tayta.loc/wp-content/uploads/2018/06/IMG_8327.jpg',0,'attachment','image/jpeg',0),(363,1,'2018-06-13 02:58:20','0000-00-00 00:00:00','','AUTO-DRAFT','','auto-draft','open','closed','','','','','2018-06-13 02:58:20','0000-00-00 00:00:00','',0,'http://tayta.loc/?post_type=product&p=363',0,'product','',0),(364,1,'2018-06-13 02:59:39','0000-00-00 00:00:00','','AUTO-DRAFT','','auto-draft','open','closed','','','','','2018-06-13 02:59:39','0000-00-00 00:00:00','',0,'http://tayta.loc/?post_type=product&p=364',0,'product','',0),(365,1,'2018-06-13 02:59:39','2018-06-13 02:59:39','','IMG_8330','','inherit','open','closed','','img_8330','','','2018-06-13 02:59:39','2018-06-13 02:59:39','',360,'http://tayta.loc/wp-content/uploads/2018/06/IMG_8330.jpg',0,'attachme