 Ý\" href=\"https://vi.wikipedia.org/wiki/Ti%E1%BA%BFng_%C3%9D\">tiếng Ý</a>: [kattedraːle di Santa Maria del fjoːre]; \"Nhà thờ Thánh Maria Bách hoa\") là nhà thờ chính của <a title=\"Firenze\" href=\"https://vi.wikipedia.org/wiki/Firenze\">Firenze</a>, <a class=\"mw-redirect\" title=\"Italia\" href=\"https://vi.wikipedia.org/wiki/Italia\">Italia</a>. <i>Il Duomo di Firenze</i>, như thành đường này vẫn thường gọi, đã được bắt đầu từ năm 1296 theo phong cách <a title=\"Kiến trúc Gothic\" href=\"https://vi.wikipedia.org/wiki/Ki%E1%BA%BFn_tr%C3%BAc_Gothic\">kiến trúc Gothic</a> với thiết kế của <a class=\"new\" title=\"Arnolfo di Cambio (trang chưa được viết)\" href=\"https://vi.wikipedia.org/w/index.php?title=Arnolfo_di_Cambio&amp;action=edit&amp;redlink=1\">Arnolfo di Cambio</a> và hoàn thành cấu trúc trong năm 1436 với những mái vòm thiết kế bởi <a class=\"new\" title=\"Filippo Brunelleschi (trang chưa được viết)\" href=\"https://vi.wikipedia.org/w/index.php?title=Filippo_Brunelleschi&amp;action=edit&amp;redlink=1\">Filippo Brunelleschi</a><sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://vi.wikipedia.org/wiki/Nh%C3%A0_th%E1%BB%9D_ch%C3%ADnh_t%C3%B2a_Firenze#cite_note-1\">[1]</a></sup>. Bên ngoài của nhà thờ được lát bằng các tấm đá cẩm thạch nhiều màu trong sắc thái khác nhau của màu xanh lá cây và màu hồng giáp màu trắng và có một thế kỷ 19 xây dựng Gothic Phục hưng mặt tiền bởi Emilio De Fabris.','publish','open','closed','','nha-tho-chinh-toa-firenze','','','2018-06-13 03:35:15','2018-06-13 03:35:15','',0,'http://tayta.loc/?post_type=product&#038;p=379',0,'product','',0),(380,1,'2018-06-13 03:31:21','2018-06-13 03:31:21','','IMG_8556','','inherit','open','closed','','img_8556','','','2018-06-13 03:31:21','2018-06-13 03:31:21','',379,'http://tayta.loc/wp-content/uploads/2018/06/IMG_8556.jpg',0,'attachment','image/jpeg',0),(381,1,'2018-06-16 06:03:41','2018-06-16 06:03:41','<ul class=\"\">\r\n 	<li class=\"\" data-spm-anchor-id=\"a2o4n.pdp.product_detail.i1.68c95e181f72Yy\">Mang đậm nét truyền thống nhưng không kém phần sang trọng</li>\r\n 	<li class=\"\">Tiện lợi, dễ dàng gấp gọn trong 1 tờ giấy</li>\r\n 	<li class=\"\">Thích hợp làm quà tặng đối tác, quà cho du khách nước ngoài</li>\r\n 	<li class=\"\">Sản phẩm được lựa chọn làm quà tặng cho Thiên Hoàng Nhật khi đến thăm VN</li>\r\n 	<li class=\"\">Không bị phai màu theo thời gian</li>\r\n 	<li class=\"\" data-spm-anchor-id=\"a2o4n.pdp.product_detail.i0.68c95e181f72Yy\">Made in Hue, Viet Nam</li>\r\n</ul>','Salt Lake Temple','<p style=\"text-align: left;\">The <b>Salt Lake Temple</b> is a <a title=\"Temple (LDS Church)\" href=\"https://en.wikipedia.org/wiki/Temple_(LDS_Church)\">temple</a> of <a title=\"The Church of Jesus Christ of Latter-day Saints\" href=\"https://en.wikipedia.org/wiki/The_Church_of_Jesus_Christ_of_Latter-day_Saints\">The Church of Jesus Christ of Latter-day Saints</a> (LDS Church) located on <a title=\"Temple Square\" href=\"https://en.wikipedia.org/wiki/Temple_Square\">Temple Square</a> in <a title=\"Salt Lake City\" href=\"https://en.wikipedia.org/wiki/Salt_Lake_City\">Salt Lake City</a>, <a title=\"Utah\" href=\"https://en.wikipedia.org/wiki/Utah\">Utah</a>, United States. At 253,015 square feet (23,505.9 m<sup>2</sup>), it is the <a title=\"Comparison of temples of The Church of Jesus Christ of Latter-day Saints\" href=\"https://en.wikipedia.org/wiki/Comparison_of_temples_of_The_Church_of_Jesus_Christ_of_Latter-day_Saints\">largest LDS temple</a> by floor area. Dedicated in 1893, it is the sixth temple completed by the church, requiring 40 years to complete, and the fourth temple built since the <a title=\"Mormon pioneers\" href=\"https://en.wikipedia.org/wiki/Mormon_pioneers\">Mormon exodus</a> from <a title=\"Nauvoo, Illinois\" href=\"https://en.wikipedia.org/wiki/Nauvoo,_Illinois\">Nauvoo, Illinois</a>, in 1846</p>','publish','open','closed','','salt-lake-temple','','','2018-06-16 06:04:12','2018-06-16 06:04:12','',0,'http://tayta.lo